import React from 'react';
import styled from "styled-components";
import animation from "../animation.css";

function Home() {
  return (
    <Contain>
        <HeadingContain><h2>Hello, DHRUv Here!!</h2></HeadingContain>
        <spanContain>Rise Again & Again, Never Give Up</spanContain>
        
    </Contain>
  )
}

const Contain=styled.div`
    margin-top: 95px;
    margin-left: 75px;
    color:#f9f9f9;
`

const HeadingContain=styled.h2`
    animation: moveInLeft .5s ease-out .5s;
    animation-fill-mode: backwards;
    font-size:1.4rem;
    font-weight: 400;
`

const spanContain=styled.div`
    animation: moveInRight .5s ease-out .5s;
    animation-fill-mode: backwards;
    font-size:1.2rem;

`

export default Home
